import React, { useState } from 'react';
import styled from 'styled-components';
import { useTheme } from '../utils/ThemeProvider';

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 20px;
  max-width: 400px;
  margin: 0 auto;
`;

const Title = styled.h2`
  font-size: 18px;
  margin-bottom: 20px;
  font-weight: 500;
`;

const ButtonContainer = styled.div`
  display: flex;
  gap: 20px;
  width: 100%;
`;

const GenderButton = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  align-items: center;
  border: 1px solid ${props => props.isSelected ? 
    (props.gender === 'male' ? props.theme.colors.TB : props.theme.colors.R400) : 
    props.theme.colors.G200};
  border-radius: 8px;
  padding: 20px;
  cursor: pointer;
  background-color: ${props => props.isSelected ? 
    (props.gender === 'male' ? `${props.theme.colors.TB}10` : `${props.theme.colors.R400}10`) : 
    '#fff'};
`;

const IconContainer = styled.div`
  width: 60px;
  height: 60px;
  border-radius: 8px;
  display: flex;
  justify-content: center;
  align-items: center;
  margin-bottom: 10px;
  background-color: ${props => props.gender === 'male' ? 
    props.theme.colors.TB : 
    props.theme.colors.R400};
`;

const MaleIcon = () => (
  <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
    <path d="M12 12C9.79 12 8 13.79 8 16C8 18.21 9.79 20 12 20C14.21 20 16 18.21 16 16C16 13.79 14.21 12 12 12ZM10 16C10 14.9 10.9 14 12 14C13.1 14 14 14.9 14 16C14 17.1 13.1 18 12 18C10.9 18 10 17.1 10 16ZM20 8V7H18V5C18 3.9 17.1 3 16 3H8C6.9 3 6 3.9 6 5V7H4V8H6V10C6 11.1 6.9 12 8 12H16C17.1 12 18 11.1 18 10V8H20ZM16 10H8V5H16V10Z" fill="white"/>
  </svg>
);

const FemaleIcon = () => (
  <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
    <path d="M12 6C13.1 6 14 5.1 14 4C14 2.9 13.1 2 12 2C10.9 2 10 2.9 10 4C10 5.1 10.9 6 12 6ZM12 8C10.9 8 10 8.9 10 10C10 11.1 10.9 12 12 12C13.1 12 14 11.1 14 10C14 8.9 13.1 8 12 8ZM12 14C9.33 14 4 15.34 4 18V20H20V18C20 15.34 14.67 14 12 14Z" fill="white"/>
  </svg>
);

const GenderText = styled.span`
  font-size: 16px;
  font-weight: 500;
  color: ${props => props.isSelected ? 
    (props.gender === 'male' ? props.theme.colors.TB : props.theme.colors.R400) : 
    props.theme.colors.G600};
`;

const GenderSelection = ({ onSelect }) => {
  const theme = useTheme();
  const [selectedGender, setSelectedGender] = useState(null);

  const handleSelect = (gender) => {
    setSelectedGender(gender);
    if (onSelect) {
      onSelect(gender);
    }
  };

  return (
    <Container>
      <Title>성별을 알려주세요.</Title>
      <ButtonContainer>
        <GenderButton 
          onClick={() => handleSelect('male')} 
          isSelected={selectedGender === 'male'}
          gender="male"
          theme={theme}
        >
          <IconContainer gender="male" theme={theme}>
            <MaleIcon />
          </IconContainer>
          <GenderText 
            isSelected={selectedGender === 'male'} 
            gender="male"
            theme={theme}
          >
            남성
          </GenderText>
        </GenderButton>

        <GenderButton 
          onClick={() => handleSelect('female')} 
          isSelected={selectedGender === 'female'}
          gender="female"
          theme={theme}
        >
          <IconContainer gender="female" theme={theme}>
            <FemaleIcon />
          </IconContainer>
          <GenderText 
            isSelected={selectedGender === 'female'} 
            gender="female"
            theme={theme}
          >
            여성
          </GenderText>
        </GenderButton>
      </ButtonContainer>
    </Container>
  );
};

export default GenderSelection;
